func TestAutogenNormCases(t *testing.T) {
	for i := range autogenNormTestCases {
		tc := &autogenNormTestCases[i]
		autogenTestNormCase(t, tc.label, "NFC", tc.data, tc.nfc, unorm.NextNFCLen)
		autogenTestNormCase(t, tc.label, "NFD", tc.data, tc.nfd, unorm.NextNFDLen)
		autogenTestNormCase(t, tc.label, "NFKC", tc.data, tc.nfkc, unorm.NextNFKCLen)
		autogenTestNormCase(t, tc.label, "NFKD", tc.data, tc.nfkd, unorm.NextNFKDLen)
	}
}

//
func autogenTestNormCase(t *testing.T, label, nType string, dataIn, dataOut []rune, testFunc func([]rune, int, int, bool) ([]rune, int)) {
	dataInLen := len(dataIn)
	dataGenerated := []rune{}
	ofs := 0
	for {
		rs, delta := testFunc(dataIn, ofs, dataInLen, false)
		if delta == 0 {
			break
		}
		dataGenerated = append(dataGenerated, rs...)
		ofs += delta
	}
	areEqual := (len(dataGenerated) == len(dataOut))
	if areEqual {
		for i := range dataGenerated {
			if dataGenerated[i] != dataOut[i] {
				areEqual = false
				break
			}
		}
	}
	if !areEqual {
		t.Errorf("\"%s\"(\"%s\") got %U", nType, label, dataGenerated)
	}
}
